import './Text.css'
import React,{useState} from 'react';
const Text = () => {
    const [input,setInput] = useState('');

    return( 
        <div className="text">
            <div className='input'>
                <textarea onChange={(event) => setInput(event.target.value) } className="in" value={input} placeholder='Type/Paste Here'></textarea>
            </div>
            <div className='output'>
                <div className='result'>
                    {input}
                </div>
            </div>

        </div>
    )
}

export default Text;
